    public void solve_v1(char[][] board) {
        if (board == null || board.length < 3 || board[0].length < 3) {
            return;
        }
        for (int i = 0; i < board.length; i++) {
            if (board[i][0] == 'O') recursiveRemark(board, i, 0, 'O', 'A');
            if (board[i][board[0].length - 1] == 'O') recursiveRemark(board, i, board[0].length - 1, 'O', 'A');
        }
        for (int i = 0; i < board[0].length; i++) {
            if (board[0][i] == 'O') recursiveRemark(board, 0, i, 'O', 'A');
            if (board[board.length - 1][i] == 'O') recursiveRemark(board, board.length - 1, i, 'O', 'A');
        }
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[i].length; j++) {
                if (board[i][j] == 'O') board[i][j] = 'X';
            }
        }
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[i].length; j++) {
                if (board[i][j] == 'A') board[i][j] = 'O';
            }
        }
    }

    private void recursiveRemark(char[][] board, int i, int j, char o, char a) {
        board[i][j] = a;
        if (j < board[i].length - 1 && board[i][j + 1] == o) recursiveRemark(board, i, j + 1, o, a);
        if (j > 0 && board[i][j - 1] == o) recursiveRemark(board, i, j - 1, o, a);
        if (i < board.length - 1 && board[i + 1][j] == o) recursiveRemark(board, i + 1, j, o, a);
        if (i > 0 && board[i - 1][j] == o) recursiveRemark(board, i - 1, j, o, a);
    }

    class Point {
        int i;
        int j;

        Point(int i, int j) {
            this.i = i;
            this.j = j;
        }
    }

