    public void solve(char[][] board) {
        if (board == null || board.length < 3 || board[0].length < 3) {
            return;
        }
        int M = board.length, N = board[0].length;
        LinkedList<Point> opens = new LinkedList<Point>();
        for (int i = 0; i < board.length; i++) {
            if (board[i][0] == 'O') opens.add(new Point(i, 0));
            if (board[i][board[0].length - 1] == 'O') opens.add(new Point(i, board[0].length - 1));
        }
        for (int i = 0; i < board[0].length; i++) {
            if (board[0][i] == 'O') opens.add(new Point(0, i));
            if (board[board.length - 1][i] == 'O') opens.add(new Point(board.length - 1, i));
        }
        while (!opens.isEmpty()) {
            Point p = opens.pop();
            board[p.i][p.j] = 'A';
            if (p.j < board[p.i].length - 1 && board[p.i][p.j + 1] == 'O') opens.add(new Point(p.i, p.j + 1));
            if (p.j > 0 && board[p.i][p.j - 1] == 'O') opens.add(new Point(p.i, p.j - 1));
            if (p.i < board.length - 1 && board[p.i + 1][p.j] == 'O') opens.add(new Point(p.i + 1, p.j));
            if (p.i > 0 && board[p.i - 1][p.j] == 'O') opens.add(new Point(p.i - 1, p.j));
        }
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[i].length; j++) {
                if (board[i][j] == 'O') board[i][j] = 'X';
            }
        }
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[i].length; j++) {
                if (board[i][j] == 'A') board[i][j] = 'O';
            }
        }
    }


